pragma solidity ^0.8.0;

/**
 * @title WarningsContract
 * @dev Contract with compiler warnings for testing
 */
contract WarningsContract {
    uint256 public value;
    uint256 private unusedVariable;  // Warning: unused variable

    function setValue(uint256 x) public {
        value = x;
    }

    // Warning: function can be restricted to view
    function getValue() public returns (uint256) {
        return value;
    }

    // Warning: unused parameter
    function unusedParam(uint256 x, uint256 y) public {
        value = x;
    }
}

